var variableClass = "";

for (let key in variables) {
    if (variables.hasOwnProperty(key)) {
        if (key.includes("I_")) variableClass = "Actuators";
        if (key.includes("A_")) variableClass = "AS-i";
        if (key.includes("O_")) variableClass = "Sensors";
        if (key.includes("F_")) variableClass = "Feedback";
        if (key.includes("C_")) variableClass = "Control";
        if (variableClass != "") node.send({ variable: key, variableClass: variableClass });  // Envia uma mensagem com a linha atual
    }
}

return null;  // Finaliza o n principal (no precisa enviar mais mensagens depois do loop)

